import React from 'react';
import ReactDOM from 'react-dom';

const HOSPEDAGENS = [
  {
    id: 1,
    nome: "Hospedagem 1",
    descricao: "Descrição da hospedagem 1",
    preco: "R$ 100,00",
    imagem: "https://picsum.photos/200/300",
  },
  {
    id: 2,
    nome: "Hospedagem 2",
    descricao: "Descrição da hospedagem 2",
    preco: "R$ 200,00",
    imagem: "https://picsum.photos/200/300",
  }
]

const Hospedagem = (props: any) => (<li>{props.nome}, ({props.descricao})</li>);

const HospedagemLista = () => {
  return HOSPEDAGENS.map((p) => {
    return (
      <Hospedagem key={p.nome} {...p} />
    )
  })
};

export default function Home() {
  return (
      <div>
      <h1>Hospedagens</h1>
      <ul>
        <HospedagemLista />
      </ul>
      </div>
  );
}
